export default function ProductList() {
  // This is static for now — we'll fetch from backend later
  const products = [
    { id: 1, name: "Chair", price: "$149", description: "Wooden Chair" },
    { id: 2, name: "Table", price: "$179", description: "Wooden Table" },
  ];

  return (
    <div className="space-y-4">
      {products.map((p) => (
        <div key={p.id} className="border p-4 rounded shadow">
          <h2 className="text-xl font-semibold">{p.name}</h2>
          <p className="text-gray-600">{p.description}</p>
          <span className="text-green-600 font-bold">{p.price}</span>
        </div>
      ))}
    </div>
  );
}
